import ctypes
import sys
import os
import tempfile
import base64

# Ваше изображение в формате base64 (пример для маленького изображения)
# Для своего изображения замените эту строку (инструкция ниже)
IMAGE_BASE64 = ""

def set_wallpaper(image_path: str):
    """
    Устанавливает обои рабочего стола
    :param image_path: Путь к файлу изображения
    """
    SPI_SETDESKWALLPAPER = 0x0014
    SPIF_UPDATEINIFILE = 0x01
    SPIF_SENDCHANGE = 0x02
    
    if not os.path.exists(image_path):
        raise FileNotFoundError(f"Файл не найден: {image_path}")
    
    # Вызов системной функции
    ctypes.windll.user32.SystemParametersInfoW(
        SPI_SETDESKWALLPAPER,
        0,
        image_path,
        SPIF_UPDATEINIFILE | SPIF_SENDCHANGE
    )

def main():
    try:
        # Декодируем изображение из base64
        image_data = base64.b64decode(IMAGE_BASE64)
        
        # Сохраняем во временный файл
        temp_file = os.path.join(tempfile.gettempdir(), "wallpaper.jpg")
        with open(temp_file, "wb") as f:
            f.write(image_data)
        
        # Устанавливаем обои
        set_wallpaper(temp_file)
        print("Обои успешно изменены!")
    except Exception as e:
        print(f"Ошибка: {str(e)}")
        sys.exit(1)

if __name__ == "__main__":
    main()